import React,{ Component } from 'react';
import axios from 'axios';
class Form1 extends Component
{
    constructor(props)
    {
        super(props)
        this.handleSubmit=this.handleSubmit.bind(this)
        this.handleChange=this.handleChange.bind(this)
        this.state={
              value:''
              }


    }

    handleSubmit(e)
    {
       var data={ [e.target.name]:e.target.value}
       axios.post('http://localhost:8080/api/insertstudent',   e.preventDefault());
       window.location.href = "/form";
       console.log(data);
    }
    handleChange(e)
    {   
        // console.log(" data ",value," ",e.target.value)
        this.setState({
            value:e.target.value
        })
    }

    render(){
        return(
            <div>
             <form onSubmit={this.handleSubmit} method="post">
                 <label> firstname
                 <input type="text" name="firstname" value={this.state.value}
                               onChange={this.handleChange} id="firstName"/></label>
                   <br/><br/>   
                   <label> username
                 <input type="text" name="username" value={this.state.value}
                               onChange={this.handleChange} id="username"/></label>
                    <br/><br/> 
                    <label> password
                 <input type="text" name="password" value={this.state.value}
                               onChange={this.handleChange} id="password"/></label>

                    <br/><br/>
                    <button type="submit">submit</button>           
                 </form>
            </div>
        )
    }

}
export default Form1
